import React from 'react';
import MenuIcon from '@material-ui/icons/Menu';
import { AppBar, Toolbar, Button, IconButton, Typography, makeStyles, createMuiTheme } from '@material-ui/core';
import SearchIcon from '@material-ui/icons/Search';

const theme = createMuiTheme();

const useStyles = makeStyles({
    title: {
        margin: theme.spacing(2)
    }
})

const Header = () => {
    const classes = useStyles;
    return(
        <>
            <AppBar display='flex' position='static'>
                <Toolbar>
                    <IconButton edge='start'>
                        <MenuIcon/>
                    </IconButton>
                    <Typography className={classes.title} variant='h6'> My CookBook </Typography>
                    <Typography edge='end'>
                        <div>
                            <SearchIcon/>
                        </div>

                    </Typography>
                </Toolbar>
            </AppBar>
        </>
    )
}

export default Header;
